export const mockLogs = [
  'Initializing Sandbox Environment...',
  'Extracting repository files...',
  'Parsing README.md...',
  'Analyzing documentation structure...',
  'Scanning for code-doc mismatches...',
  'Checking dependency versions...',
  'Validating setup instructions...',
  'Running AI analysis model...',
  'Generating health score...',
  'Compiling recommendations...',
  'Analysis complete ✓'
];

export const trendData = [
  { day: 'Day 1', score: 65 },
  { day: 'Day 10', score: 72 },
  { day: 'Day 20', score: 78 },
  { day: 'Day 30', score: 82 }
];

export const rotAlerts = [
  { type: 'error', message: 'Missing File: setup.py', severity: 'high' },
  { type: 'warning', message: 'Outdated Node Version (v14 -> v18)', severity: 'medium' },
  { type: 'info', message: 'API documentation needs update', severity: 'low' }
];
